import React from 'react'
import CardPortfolio from '../CardPortfolio/CardPortfolio';

interface Props {
  portfolioValues: string[];
  onPortfolioDelete: (e: React.SyntheticEvent) => void
}

const PortfolioList = ({portfolioValues, onPortfolioDelete}: Props) => {
  return (
    <>
      <h3>Мое портфолио</h3>
      <ul>
        { 
          portfolioValues 
          && portfolioValues.map(
            (portfolioValue) => {return <CardPortfolio portfolioValue={portfolioValue} onPortfolioDelete={onPortfolioDelete}/>;}
          )}
      </ul>
    </>
  )
}

export default PortfolioList
